import "./ExpensesList.css"
import ExpenseItem from "./ExpenseItem";

function ExpensesList(props) {

    const expensesObjet = props.data

    return (

        <div className="expenses">
            {expensesObjet.forEach(expense => {
                return <ExpenseItem date={expense.date } title={expense.title} price={expense.price}/>
            })};
            
        </div>);
}
    export default ExpensesList
